function deleteAddress (id) {
  fetch(`http://localhost:3001/addresses/${id}`, {
    method: "DELETE",
  })
  .then(response => response.json())
  JSON.parse(JSON.stringify(userData))
  .catch((err) => console.log(err));
}

export default deleteAddress;
